import React from "react";
import { AppBar, Toolbar, Button, Container, Typography, TextField, Box } from "@mui/material";
import { IconButton } from "@mui/material";
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown'; // For the dropdown icons
import './CybersecurityPage.css'; // Import the CSS file

const CybersecurityPage = () => {
  return (
    <div className="root">
      {/* Navigation Bar */}
      <AppBar
        position="static"
        sx={{
          backgroundColor: "rgba(0, 0, 0, 0.9)", // Black background with slight transparency
          borderBottom: "0.5px solid #f5f5f5", // Off-white border
          paddingLeft: "10vw", // Adjust left padding if needed
          paddingRight: "10vw", // Adjust right padding if needed
          height: "10vh"
        }}
      >
        <Toolbar sx={{ justifyContent: "space-between", marginTop: "15px" }}>
          {/* Left section with logo and text */}
          {/* <Box sx={{ display: "flex", alignItems: "center" }}>
            <IconButton disableRipple sx={{ color: "#00e3ab" }}>
              <span style={{ width: '8px', height: '8px', backgroundColor: '#00e3ab', borderRadius: '50%', marginRight: '8px' }} />
            </IconButton>
            <Typography variant="h6" sx={{ color: "#fff", fontWeight: "bold" }}>
              apni sec
          </Typography>
          </Box> */}

          {/* Middle section with dropdown buttons */}
          <Box sx={{ display: "flex", alignItems: "center" }}>
            <Button color="inherit" endIcon={<ArrowDropDownIcon />} sx={{ color: "#fff" }}>
              Products
          </Button>
            <Button color="inherit" endIcon={<ArrowDropDownIcon />} sx={{ color: "#fff", marginLeft: "10px" }}>
              Services
          </Button>
          </Box>

          {/* Right section with "Book Demo" button */}
          <Button
            variant="contained"
            sx={{
              backgroundColor: "#00e3ab",
              color: "#000",
              borderRadius: "10px", // Rounded corners to match your design
              textTransform: "none", // Keep the button text case unchanged
              padding: "6px 20px", // Adjust padding to match button size
              "&:hover": {
                backgroundColor: "#00c598", // Slightly darker green on hover
              },
            }}
          >
            Book Demo
        </Button>
        </Toolbar>
      </AppBar>

      {/* Main Content */}

      <Box
        className="content"
        sx={{
          width: "101vw",
          height: "70vh",
          // margin: "auto",
          // padding: 0,
          backgroundImage: "url('/assets/background.png')", // Replace with your image path
          backgroundSize: "cover", // Ensures the image covers the entire container
          backgroundPosition: "center", // Centers the background image
          backgroundRepeat: "no-repeat", // Prevents the image from repeating
          color: "#fff" // Optional: Set text color to white for readability over the background
        }}
      >
        <Box
          sx={{
            width: "50vw",
            height: "90vh",
            // alignContent: "center",
            textAlign: "left",
            paddingLeft: "6vw",
            marginTop: "20vh"
            // margin: "auto",
            // padding: 0,
            // backgroundImage: "url('/assets/background.png')", // Replace with your image path
            // backgroundSize: "cover", // Ensures the image covers the entire container
            // backgroundPosition: "center", // Centers the background image
            // backgroundRepeat: "no-repeat", // Prevents the image from repeating
            // color: "#fff" // Optional: Set text color to white for readability over the background
          }}>
          <Typography className="heading" sx={{fontWeight: 900, fontSize:"60px"}}>
            Comprehensive <span style={{ color: "#00FFB2" }}>Cybersecurity</span>
            <br /> Strategies for Growth and Resilience
          </Typography>
          <Typography className="subheading">
            Unlock your business's full potential with our comprehensive cybersecurity strategies.
            Safeguard your growth and resilience in the digital age.
          </Typography>
          <Button
            variant="contained"
            sx={{
              fontSize: "16px",
              marginTop: "20px",
              backgroundColor: "#00e3ab",
              color: "#000",
              borderRadius: "10px", // Rounded corners to match your design
              textTransform: "none", // Keep the button text case unchanged
              padding: "6px 20px", // Adjust padding to match button size
              "&:hover": {
                backgroundColor: "#00c598", // Slightly darker green on hover
              },
            }}
          >
            Talk with us
        </Button>
        </Box>
      </Box>



      <Container className="content" sx={{ width: "90vh" }}>
        <Typography variant="h2" className="heading">
          Comprehensive <span style={{ color: "#00FFB2" }}>Cybersecurity</span>
          <br /> Strategies for Growth and Resilience
        </Typography>
        <Typography className="subheading">
          Unlock your business's full potential with our comprehensive cybersecurity strategies.
          Safeguard your growth and resilience in the digital age.
        </Typography>
        <Button
            variant="contained"
            sx={{
              backgroundColor: "#00e3ab",
              color: "#000",
              borderRadius: "10px", // Rounded corners to match your design
              textTransform: "none", // Keep the button text case unchanged
              padding: "6px 20px", // Adjust padding to match button size
              "&:hover": {
                backgroundColor: "#00c598", // Slightly darker green on hover
              },
            }}
          >
            Book Demo
        </Button>
      </Container>

      {/* Footer */}
      <footer className="footer">
        <Typography variant="body2" color="textSecondary">
          We are providing cybersecurity services to some of the Worldâ€™s leading companies
        </Typography>

        {/* Company Logos */}
        <div className="footerLogos">
          {/* Example Logos */}
          <img
            src="https://upload.wikimedia.org/wikipedia/commons/a/a6/Logo_NIKE.svg"
            alt="Nike"
            className="companyLogo"
          />
          <img
            src="https://upload.wikimedia.org/wikipedia/commons/5/5e/Apple_logo_black.svg"
            alt="Apple"
            className="companyLogo"
          />
          <img
            src="https://upload.wikimedia.org/wikipedia/commons/e/e4/BBC_logo.svg"
            alt="BBC"
            className="companyLogo"
          />
          {/* Add more logos as necessary */}
        </div>
      </footer>

    </div>
  );
};

export default CybersecurityPage;
